import React, { useState, useEffect } from "react";
import getBreeds from "../helpers/getBreeds";

const initialBreeds = [
	{
		id: 1,
		name: "Boxer",
	},
	{
		id: 2,
		name: "Husky",
	},
	{
		id: 3,
		name: "Pintscher",
	},
];

const Card = () => {
    const [breeds, setBreeds] = useState(initialBreeds);

    useEffect(() => {
        updateBreeds();
    }, []);

    const updateBreeds = () => {
        getBreeds()
        .then((newBreeds) => {
            setBreeds(newBreeds)
        })
        .catch(
            console.log("Erro")
        )
    }

return (
	<div className='card'>
              <img src={breed.url_image} alt={breed.name} />
            <p>dog name</p>
        
	</div>
);
}

export default Card;
